import React from "react";
import fotoPerfil from "../images/fotoPerfil.jepg"

const Main = () => {
  return (
    <main className="row align-items-center">
      <div className="container-fluid">
        <div className="row">
          <div className="container">
            <h2 className="text-start">Who I am?</h2>
            <h3 className="text-center">
              I am a Product Design Engineer (graduated from EAFIT University)
              and front-end developer, with more than three years of experience
              in areas of engineering, projects, design and web development.
              Currently I work as a freelance programmer. <br /> <br />
              On a personal level I recognize strengths to learn on my own, work
              as a team, be focused, perseverant and passionate about constant
              learning.
            </h3>
          </div>
        </div>
      </div>
    </main>
  );
};

export default Main;
